SET NOCOUNT ON

DECLARE ecur CURSOR FOR
SELECT DISTINCT Company, Employee, LastName, FirstName, TermDate, EligibleDate FROM billo.ELIGIBLEFOR401K_USRC ORDER BY Company, Employee FOR READ ONLY

DECLARE @DoUpdate	int

SELECT @DoUpdate=0 -- Change to 1 to actually perform update.

declare	@Company		int			--NULL
declare	@Employee		int			--NULL	
declare	@LastName		varchar(50)	--NULL
declare	@FirstName		varchar(50)	--NULL
declare	@TermDate		datetime	--NULL
declare	@EligibleDate	datetime	--NULL 

declare	@CurEligibleDate	datetime	--NULL 

DECLARE @empfound int
DECLARE @empmissing int
DECLARE @empcount int
DECLARE @updcnt int

SELECT @empfound=0, @empmissing=0
OPEN ecur
FETCH ecur INTO @Company, @Employee, @LastName, @FirstName, @TermDate, @EligibleDate

WHILE @@fetch_status=0
BEGIN
	
	SELECT @empcount=COUNT(*) FROM PEOPLE WHERE REFERENCENUMBER=@Employee
	
	IF @empcount=1
	BEGIN
	SELECT @empfound=@empfound+1
	PRINT 
		'+ '
	+	CAST(@empcount AS CHAR(8))
	+	cast(coalesce(@Employee,'') AS CHAR(12))
	+	cast(coalesce(@LastName,'') AS CHAR(30))
	+	cast(coalesce(@FirstName,'') AS CHAR(30))
	+	CONVERT(varchar(10),@EligibleDate,102)
	
	SELECT @CurEligibleDate=COALESCE(ELIGIBLEFOR401K,'') FROM PEOPLE WHERE REFERENCENUMBER=@Employee
	
	IF @CurEligibleDate <> @EligibleDate
	BEGIN
		SELECT @updcnt = 0
		IF @DoUpdate=1
		BEGIN 
			UPDATE PEOPLE SET ELIGIBLEFOR401K=@EligibleDate WHERE REFERENCENUMBER=@Employee
			SELECT @updcnt = @@rowcount
		END 
		
		PRINT 
			'[' + CAST(@updcnt AS CHAR(5)) +'] '
		+	CAST('Update ELIGIBLEFOR401K from ' AS CHAR(30))
		+	cast(COALESCE(CONVERT(varchar(10),@CurEligibleDate,102),'null') AS CHAR(10))
		+	' to '
		+	cast(COALESCE(CONVERT(varchar(10),@EligibleDate,102),'null') AS CHAR(10))	

	END
	END
	ELSE
	BEGIN
	SELECT @empmissing=@empmissing+1
	PRINT 
		'- '
	+	CAST(@empcount AS CHAR(8))
	+	cast(coalesce(@Employee,'') AS CHAR(12))
	+	cast(coalesce(@LastName,'') AS CHAR(30))
	+	cast(coalesce(@FirstName,'') AS CHAR(30))	
	END
	
	PRINT ''

	FETCH ecur INTO @Company, @Employee, @LastName, @FirstName, @TermDate, @EligibleDate

END
CLOSE ecur
DEALLOCATE ecur
PRINT ''

PRINT '+ ' + CAST(@empfound AS CHAR(8)) + ' employee records found'
PRINT '- ' + CAST(@empmissing AS CHAR(8)) + ' employee records missing'

